import { useNavigate } from "react-router-dom";
export default function navRoute() {

const navigate = useNavigate();

const dashboardRoute = async (event) => {
    const navigate = useNavigate();

    navigate('/dashboard');

  }
  const usersRoute = async (event) => {
    const navigate = useNavigate();

    navigate('/Users');
  }
  const constantsRoute = async (event) => {
    const navigate = useNavigate();

    navigate('/Constants');
  }
}
